import React from "react"
import ReactDOM from "react-dom"

function MyApp() {
    return(
        <ul>
            <li>tasty</li>
            <li>tastier</li>
            <li>tastiest</li>
        </ul>
    )
}

ReactDOM.render(
    <MyApp />,
     document.getElementById("root")
)
